import logo from './logo.svg';
import './App.css';
import "bootstrap/dist/css/bootstrap.css";
import { Navbar, Nav, Dropdown, Tabs, Table, Tab } from "react-bootstrap";
import {Component} from "react";

class App extends Component {
  render() {
    const students = [
      {name: 'Иванов Иван Иванович', markPrIS: 5, markSII: 4},
      {name: 'Петров Пётр Петрович', markPrIS: 3, markSII: 2}
    ];
    return (
        <div className="App">
          <JournalTable students={students}/>
        </div>
    );
  }
}

class JournalTable extends Component {
  render() {
    return <Table bordered>
      <thead>
      <tr>
        <th>#</th>
        <th>ФИО</th>
        <th>ПрИС</th>
        <th>СИИ</th>
      </tr>
      </thead>
      <tbody>
      {this.props.students.map((student, index) => {
        return <tr>
          <td>{index + 1}</td>
          <td>{student.name}</td>
          <td>{student.markPrIS}</td><td>{student.markSII}</td>
        </tr>
      })}
      </tbody>
    </Table>
  }
}

export default App;
